import React from "react";


function Card(props){
    return(
    <> <div className="top">
             <img className="circle-img" src={props.img} alt="meme_img" />
        </div>
        <div className="bottom">
        <button class={props.name}><h2 className="name">{props.name}</h2></button>
        </div></>

    );
}

export default Card;
